import (
	context "context"
	fern "github.com/grpc-proto-exhaustive/fern"
	fernclient "github.com/grpc-proto-exhaustive/fern/client"
	option "github.com/grpc-proto-exhaustive/fern/option"
)

client := fernclient.NewClient(
	option.WithApiKey(
		"<YOUR_ApiKey>",
	),
)
response, err := client.Dataservice.Upload(
	context.TODO(),
	&fern.UploadRequest{
		Columns: []*fern.Column{
			&fern.Column{
				Id: "id",
				Values: []float64{
					1.1,
				},
			},
		},
	},
)

